import{_ as e,c as o,o as a,a4 as i}from"./chunks/framework.nQaBHiNx.js";const s="/assets/291728755-273dca85-faa0-47ae-91df-cadf50a8d93c.85Xk1nI_.png",r="/assets/291729573-749ebf4e-e79c-40ba-aba4-d53d68980d2e.DjW8FgZr.png",t="/assets/291729726-29d54dfe-1e52-4825-a725-72ef104637f6.Dml7mBnh.png",d="/assets/291731440-2a8a10d3-4846-4c5a-8596-b4fcd74b8557.BdPjwJSF.png",_=JSON.parse('{"title":"Mac OS (iOS)","description":"","frontmatter":{},"headers":[],"relativePath":"docs/running-on-device/ios-macos.md","filePath":"docs/running-on-device/ios-macos.md"}'),c={name:"docs/running-on-device/ios-macos.md"},n=i('<h1 id="mac-os-ios" tabindex="-1">Mac OS (iOS) <a class="header-anchor" href="#mac-os-ios" aria-label="Permalink to &quot;Mac OS (iOS)&quot;">​</a></h1><h2 id="_1-conecte-seu-dispositivo-via-usb" tabindex="-1">1. Conecte seu dispositivo via USB <a class="header-anchor" href="#_1-conecte-seu-dispositivo-via-usb" aria-label="Permalink to &quot;1. Conecte seu dispositivo via USB&quot;">​</a></h2><p>Conecte seu dispositivo iOS ao Mac usando um cabo USB para Lightning. Navegue até a pasta <code>ios</code> em seu projeto e abra o arquivo <code>.xcodeproj</code> ou, se estiver usando CocoaPods, abra <code>.xcworkspace</code>, dentro dele usando o Xcode.</p><p>Se esta for a primeira vez que você executa um aplicativo em seu dispositivo iOS, talvez seja necessário registrar seu dispositivo para desenvolvimento. Abra o menu <strong>Product</strong> na barra de menu do Xcode e vá para <strong>Destination</strong>. Procure e selecione seu dispositivo na lista. O Xcode registrará seu dispositivo para desenvolvimento.</p><h2 id="_2-configure-a-assinatura-de-codigo" tabindex="-1">2. Configure a assinatura de código <a class="header-anchor" href="#_2-configure-a-assinatura-de-codigo" aria-label="Permalink to &quot;2. Configure a assinatura de código&quot;">​</a></h2><p>Registre-se para obter uma <a href="https://developer.apple.com/" target="_blank" rel="noreferrer">conta de desenvolvedor Apple</a>, caso ainda não tenha uma.</p><p>Selecione seu projeto no Xcode Project Navigator e, em seguida, selecione seu destino principal (deve ter o mesmo nome do seu projeto). Procure a aba “General”. Vá para &quot;Signing&quot; e certifique-se de que sua conta ou equipe de desenvolvedor Apple esteja selecionada no menu suspenso Equipe. Faça o mesmo para o alvo de testes (termina com Tests e está abaixo do seu alvo principal).</p><p>Repita esta etapa para o destino Testes em seu projeto.</p><p><img src="'+s+'" alt="image"></p><h2 id="_3-crie-e-execute-seu-aplicativo" tabindex="-1">3. Crie e execute seu aplicativo <a class="header-anchor" href="#_3-crie-e-execute-seu-aplicativo" aria-label="Permalink to &quot;3. Crie e execute seu aplicativo&quot;">​</a></h2><p>Se tudo estiver configurado corretamente, seu dispositivo será listado como destino de compilação na barra de ferramentas do Xcode e também aparecerá no painel Dispositivos (<code>Shift ⇧</code> + <code>Cmd ⌘</code> + <code>2</code>). Agora você pode pressionar o botão <strong>Build and run</strong> (<code>Cmd ⌘</code> + <code>R</code>) ou selecionar <strong>Run</strong> no menu <strong>Product</strong>. Seu aplicativo será iniciado em seu dispositivo em breve.</p><p><img src="'+r+'" alt="image"></p><div class="tip custom-block"><p class="custom-block-title">DICA</p><p>Se você tiver algum problema, consulte os documentos da <a href="https://developer.apple.com/library/content/documentation/IDEs/Conceptual/AppDistributionGuide/LaunchingYourApponDevices/LaunchingYourApponDevices.html#//apple_ref/doc/uid/TP40012582-CH27-SW4" target="_blank" rel="noreferrer">Apple Como iniciar seu aplicativo em um dispositivo</a>.</p></div><h2 id="conectando-se-ao-servidor-de-desenvolvimento" tabindex="-1">Conectando-se ao servidor de desenvolvimento <a class="header-anchor" href="#conectando-se-ao-servidor-de-desenvolvimento" aria-label="Permalink to &quot;Conectando-se ao servidor de desenvolvimento&quot;">​</a></h2><p>Você também pode iterar rapidamente em um dispositivo usando o servidor de desenvolvimento. Você só precisa estar na mesma rede Wi-Fi do seu computador. Agite seu dispositivo para abrir o <a href="/docs/debugging.html">Dev Menu</a> e ative o Live Reload. Seu aplicativo será recarregado sempre que seu código JavaScript for alterado.</p><p><img src="'+t+'" alt="image"></p><h2 id="solucao-de-problemas" tabindex="-1">Solução de problemas <a class="header-anchor" href="#solucao-de-problemas" aria-label="Permalink to &quot;Solução de problemas&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">DICA</p><p>Se você tiver algum problema, certifique-se de que seu Mac e seu dispositivo estejam na mesma rede e possam se comunicar. Muitas redes sem fio abertas com portais cativos são configuradas para impedir que dispositivos alcancem outros dispositivos na rede. Você pode usar o recurso Personal Hotspot do seu dispositivo neste caso. Você também pode compartilhar sua conexão de Internet (Wi-Fi/Ethernet) do seu Mac para o seu dispositivo via USB e conectar-se ao empacotador através deste túnel para velocidades de transferência muito altas.</p></div><p>Ao tentar se conectar ao servidor de desenvolvimento, você poderá receber uma <a href="/docs/debugging.html">tela vermelha com um erro</a> dizendo:</p><div class="tip custom-block"><p class="custom-block-title">DICA</p><p>A conexão com <code>http://localhost:8081/debugger-proxy?role=client</code> expirou. Você está executando o proxy do nó? Se você estiver executando no dispositivo, verifique se possui o endereço IP correto em <code>RCTWebSocketExecutor.m</code>.</p></div><p>Para resolver este problema verifique os seguintes pontos.</p><h3 id="_1-rede-wi-fi" tabindex="-1">1. Rede Wi-Fi. <a class="header-anchor" href="#_1-rede-wi-fi" aria-label="Permalink to &quot;1. Rede Wi-Fi.&quot;">​</a></h3><p>Certifique-se de que seu laptop e telefone estejam na mesma rede Wi-Fi.</p><h3 id="_2-endereco-ip" tabindex="-1">2. Endereço IP <a class="header-anchor" href="#_2-endereco-ip" aria-label="Permalink to &quot;2. Endereço IP&quot;">​</a></h3><p>Certifique-se de que o script de construção detectou o endereço IP da sua máquina corretamente (por exemplo, <code>10.0.1.123</code>).</p><p><img src="'+d+'" alt="image"></p><p>Abra a aba Report Navigator, selecione o último Build e pesquise IP= seguido de um endereço IP. O endereço IP incorporado no aplicativo deve corresponder ao endereço IP da sua máquina.</p><h2 id="construindo-seu-aplicativo-para-producao" tabindex="-1">Construindo seu aplicativo para produção <a class="header-anchor" href="#construindo-seu-aplicativo-para-producao" aria-label="Permalink to &quot;Construindo seu aplicativo para produção&quot;">​</a></h2><p>Você construiu um ótimo aplicativo usando React Native e agora está ansioso para lançá-lo na App Store. O processo é igual ao de qualquer outro aplicativo iOS nativo, com algumas considerações adicionais a serem levadas em consideração. Siga o guia de publicação na <a href="/docs/publishing-to-app-store.html">Apple App Store</a> para saber mais.</p>',29),p=[n];function u(l,m,v,g,h,b){return a(),o("div",null,p)}const q=e(c,[["render",u]]);export{_ as __pageData,q as default};
